Whirlpool Dishwasher Rack Repair Kit, White
Genuine Original Equipment Manufacturer (OEM) parts! This tine tip repair kit (part number is for dishwashers. Tine tip repair kit includes tine tips and vinyl touch-up liquid to repair damaged or rusted dishrack tines. Apply the vinyl touch-up liquid in a well-ventilated area. For Kitchenaid, Whirlpool, Kenmore, Kenmore Elite, Maytag, Jenn-Air, Amana, Ikea, Estate, Crosley, Inglis, Magic Chef, Roper, Fulgor, & Kenmore Pro. This part is compatible with models including; This is a manufacturer substitution. Part may differ in appearance but is a functional equivalent to prior parts including;
